export const es ={
  salutation:{
    hello : 'Olá mundo'
  },
  buttonsHead:{
    b1 : 'Visita mi Github',
    b2: 'Visita mi Linkedin'
  },

  works:{
    h2: 'Trabajos',
    p : 'Aquí les presento mis trabajos.',
    articleRelogio: 'Reloj',
    articleTeste: 'prueba de mecanografía',
    articleCalc: 'Calculadora',
  },

  about:{
    h2: 'Acerca de mi',
    p1: '¡Hola! Soy Daniel y me dedico a lograr mis metas profesionales. Nací en Brasilia y crecí en Valparaíso de Goiás y actualmente tengo 25 años.',
    p2: 'Soy técnico en TI de la Escuela Técnica de Brasilia (ETB) y actualmente soy estudiante de Análisis y Desarrollo de Sistemas en Anhanguera. Tuve la oportunidad de trabajar como pasante en Ikhon Tecnologia, donde pude aprender mucho y aplicar mis habilidades.',
    p3: 'Durante mi curso de Técnico en Computación, tuve la oportunidad de desarrollar un sistema y poner en práctica mis conocimientos. Decidí dedicarme a Análisis y Desarrollo de Sistemas para especializarme como desarrollador frontend.',
    p4: 'Estou motivado para continuar aprendendo e aprimorando minhas habilidades profissionais. Tenho confiança de que minhas experiências e estudos irão me ajudar a alcançar meus objetivos.',
    p5: 'Espero que este portfólio ajude você a entender melhor minhas habilidades e experiência, e que possamos ter a oportunidade de trabalhar juntos em um futuro próximo. Se você tiver alguma dúvida ou quiser discutir um projeto, fique à vontade para entrar em contato. Obrigado pela visita!',
  },
  footer:{
    span:'Feito com amor ♥ Daniel Vitor'
  }
}
